```

This script is running under the **SLURM** workload manager. 

**Details:**

* **Software:** The script utilizes Python and requires a conda environment to be activated.
* **Resources:** It requests a runtime of 4 hours, access to 1 GPU, 40 GB of memory, and 4 CPU cores.
* **Other:** The script also utilizes SLURM features like email notification on job completion and array job submission to run multiple experiments in parallel.
